// Made by GRPTeam202205
import axios from 'axios'

const Bilibili_BASE_URL = 'products';

class BilibiliService{
    getAllProducts(){
        return axios.get(Bilibili_BASE_URL);
    }
    getDistinctProducts(){
        return axios.get('sortProductsByName');
    }
    deleteProduct(productName){
        return axios.delete(`deleteProductByName/${productName}`);
    }
    sortAscending(pageNum, itemsPerPage, field){
        return axios.get(`productPaginationAndSort/${(pageNum)}/${(itemsPerPage)}/${(field)}`);
    }
    pagination(pageNum, itemsPerPage){
        return axios.get(`productPagination/${(pageNum)}/${(itemsPerPage)}`);
    }
    getProductsWithGivenType(typeName){
        return axios.get(`productsWithGivenType/${typeName}`)
    }
    getRemainingQuantity(name, supplier){
        return axios.get(`/remainingQuantity/${(name)}/${(supplier)}`)
    }
}

export default new BilibiliService()
